// Solution 1:
const sortByHeight = (arr) => {
    let tree = arr.filter(el => el!== "g").sort((a, b) => a - b);
    let ground = [];
    for (let i = 0; i < arr.length; i++) {
        if (arr[i] === "g") {
            ground.push(tree.shift());
        } else {
            continue;
        }
    }
    return [...ground,...tree];
}

